// src/components/NavBar.js
import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';
import dubaiFlag from '../pages/images/dubai-flag.png';

const NavBar = ({ changeLanguage }) => {
  return (
    <nav className="navbar">
      <ul className="nav-links">
        <li><Link to="/">{i18n.t('Home')}</Link></li>
        <li><Link to="/services">{i18n.t('Services')}</Link></li>
        <li><Link to="/real-estate">{i18n.t('Real Estate')}</Link></li>
        <li><Link to="/medical-vacation">{i18n.t('Medical Vacation')}</Link></li>
        <li><Link to="/business-solutions">{i18n.t('Business Solutions')}</Link></li>
        <li><Link to="/about-us">{i18n.t('About Us')}</Link></li>
        <li><Link to="/contact">{i18n.t('Contact')}</Link></li>
      </ul>
      <div className="language-switch">
        <button onClick={() => changeLanguage('ar')}>{i18n.t('Arabic')}</button>
        <button onClick={() => changeLanguage('en')}>{i18n.t('English')}</button>
        <img src={dubaiFlag} alt="Dubai Flag" className="dubai-flag" />
      </div>
    </nav>
  );
};

export default NavBar;
